ಆತ್ಮೀಯ $ {FULLNAME ಅವರನ್ನು},
ಡಿಜಿಟಲ್ ಐಡೆಂಟಿಟಿ ವೇದಿಕೆ ನೋಂದಾಯಿಸಿಕೊಳ್ಳುವ ಧನ್ಯವಾದಗಳು. "$ {ಹೋಗಲಾಡಿಸಲು}" "ನಿಮ್ಮ ನೋಂದಣಿ ಐಡಿ ಆಗಿದೆ". ಕೆಳಗಿನಂತೆ ಜನಸಂಖ್ಯಾ ವಿವರಗಳಿವೆ:
1. ದಿನಾಂಕ: $ {ದಿನಾಂಕ}
2. ಪೂರ್ಣ ಹೆಸರು: $ {FULLNAME ಅವರನ್ನು}
3. ಜನ್ಮದಿನಾಂಕ: $ {ಡಿಓಬಿ}
4. ಲಿಂಗ: $ {ಲಿಂಗ}
5. ವಿಳಾಸ ಸಾಲು 1: $ {ADDRESSLINE1}
6. ವಿಳಾಸ ಸಾಲು 2: $ {ADDRESSLINE2}
7. ವಿಳಾಸ ಸಾಲು 3: $ {ADDRESSLINE3}
8. ಪ್ರದೇಶ: $ {ಪ್ರದೇಶಕ್ಕೆ}
9. ಸಿಟಿ: $ {city}
10. ಪ್ರಾಂತ್ಯ: $ {PROVINCE}
11. ಕೋಡ್: $ {POSTALCODE}
12. ಮೊಬೈಲ್ ಸಂಖ್ಯೆ: $ {ಫೋನ್}
13. ಇಮೇಲ್: $ {EMAIL} ಗೆ

